<script>
import Nav from '@/components/front/Nav'
import Swal from 'sweetalert2'
import { required, email } from 'vuelidate/lib/validators'
import Cookies from 'js-cookie'
export default {
  name: 'Login',
  components: { Nav },
  data () {
    return {
      msg: 'Login Veloxid ',
      msg_login: 'Iniciar Sesin',
      login_email: 'Email',
      login_password: 'Contrasea',
      login_button: 'Iniciar Sesin',
      data: {
        email: '',
        password: ''
      }
    }
  },
  methods: {
    async login () {
      await this.$http
        .post('/login', this.data, {
          headers: { 'Content-Type': 'application/json' },
          withCredentials: 'include'
        })
        .then(res => {
          this.data = res.data
          if (this.data.message === 'Success') {
            Cookies.set('userLogged', 'Success')
            this.$http
              .get('/user', {
                headers: { 'Content-Type': 'application/json' },
                withCredentials: 'include'
              })
              .then(res => {
                Cookies.set('rolLogged', res.data.role.id)
                if (Cookies.get('rolLogged') === '3') {
                  this.$router.push('/home')
                } 
                if (Cookies.get('rolLogged') === '1') {
                  this.$router.push('/tracking')
                } 
                if (Cookies.get('rolLogged') === '4') {
                  this.$router.push('/usuarios')
                }
                if (Cookies.get('rolLogged') === '2') {
                  this.$router.push('/confirmacionconductor')
                }
              })
          } else {
            Swal.fire(
              'Error!',
              'Las credenciales ingresadas no son vlidas!',
              'error'
            )
          }
        })
        .catch(function () {
          Swal.fire(
            'Error!',
            'Las credenciales ingresadas no son vlidas!',
            'error'
          )
        })
    }
  },
  validations: {
    data: {
      email: {
        required,
        email
      },
      password: {
        required
      }
    }
  }
}
</script>

